import React from "react";
import { Col, Container, Row} from "react-bootstrap";
import a from "./img/team/1.jpg";
import b from "./img/team/2.jpg";
import c from "./img/team/3.jpg";
import "./ourTeam.css";

const Team = (props) => {
    return (

        <Col>
        <div>

            <img className="card-img" src={props.img} alt={props.alt} style={{borderRadius: "100pt", height: "90pt", width: "90pt"}} />
            <h5>{props.name}</h5>
            <p>{props.summ}</p>

            </div>
        </Col>
    )
}

const OurTeam = () => {
    return ( 
        <div style={{paddingTop: "130pt", paddingBottom: "130pt", background: "rgb(148 41 229)", color: "white"}}>
            <h1>Our Team</h1><br />
            <Container>

            <Row>
                    <Team img={a} name="Kate Smith" summ="fdsfdsfsfsf" alt="firstimg" />
                    <Team img={b} name="Jason Statham" summ="fdsfdsfsfsf" alt ="secondimg" />
                    <Team img={c} name="David" summ="fdsfdsfsfsf" alt="thirdimg" />
            </Row>
            </Container>
        </div>
     );
}

export default OurTeam;
